import './CodeInfo.css';

const CodeInfo = ({ name, des, code }) => {
    return (
        <div className='codeinfo'>
            <p>For more information, see <span>Setting Up a {name} Development Environment</span></p>
            <p>{des}</p>
            <p>{code}</p>
        </div>
    )
};

export default CodeInfo;
